exports.setIntegerParameter=function(c,b,a){if(c[b]==null){c[b]=a}else{if(typeof c[b]!=="number"&&c[b]!==parseInt(c[b],10)){throw"object field ["+b+"] must be a numeric integer value, attempted to set to ["+c[b]+"] type of ["+typeof c[b]+"]"}}};exports.setBooleanParameter=function(c,b,a){if(c[b]==null){c[b]=a}else{if(typeof c[b]!=="boolean"){throw"object field ["+b+"] must be a boolean value, attempted to set to ["+c[b]+"] type of ["+typeof c[b]+"]"}}};exports.setStringParameter=function(c,b,a){if(c[b]==null){c[b]=a}else{if(typeof c[b]!=="string"){throw"object field ["+b+"] must be a string value, attempted to set to ["+c[b]+"] type of ["+typeof c[b]+"]"}}};